import React from 'react';

import { Container } from './styles';

interface ISelectInputProps {
    options: {
        value: string | number;
        label: string | number;
    }[],
}

const SelectInput: React.FC<ISelectInputProps> = () => {
    return (
        <Container>
            <select>
                <option value="teste">teste</option>
            </select>
        </Container>
    );
}

export default SelectInput;
